- input: "TEXT\x1CC00141572\x1C.TEXT\x1C\x1CF3XN\x1CThe State of Oregon allows $50
    per individual as a tax credit.  None of the contributions in this 2011 mid year
    report were over $200 per individual.  Memo item on 1/10/11 to AT&T Mobility for
    $75 belongs to check # 1177 to Lois Anderson for $75 for phone.  All memo items
    on 2/1/11 belong to check # 1181 to Oregon Right to Life for $17,891.64 for salaries
    and payroll taxes.  Memo item on 3/22/11 for $75 to AT&T Mobility belongs to check
    # 1186 to Lois Anderson for cell phone expenses. Two memo items to United Airlines
    for $25 each and one to Portland Internation Airport for $50 belong to check #
    1188 written on 3/22/2011 to Lois Anderson for $100.00 for travel.  All memo items
    on 3/31/2011 belong to check # 1192 written to Oregon Right to Life for $11,683.83
    for payroll.  Memo item on 5/15/11 belongs to check # 1204 to Lois Anderson for
    $75 for telephone.  Memo items on 5/31/2011 belong to check # 1207 to Oregon Right
    to Life for wages.  Memo items on 4/29 to American Airlines and 5/23 to Surfrider
    Resort belong to check # 1208 to Gayle Atteberry for $1062.20.  Memo item on 6/1/2011
    to Conclusive Marketing for $437.50 belongs to ck# 1210 on 6/22/11 to Jane Groff.\n"
